import React, { useState } from 'react';
import './style.css';

function AddButton() {
  const [name, setName] = useState(0);
  const logs = ()=>{
    console.log("ここにでる");
    setName(name+1)
  }
  return (
      <div className="divbtn" onClick={logs}><div className="indivtext">{name}</div></div>
  );
}

export default AddButton;
